const Display = () => {

    const API = 'https://assessment.api.vweb.app/products';

    const fetchApi = async (url) => {

        const response = await fetch(url);
        const data = await response.json();
        console.log(data);
    }

    useEffect(() => {
        fetchApi(API);
    })

    return (
        <>
       <div >
        {
            API.map((curItem) =>{
                return curItem;

            })
        }
       </div>

        </>
    )
}

export default Display
